import React, { useEffect, useState } from "react";
import { see } from "./workoutarray";


export const Look=(val)=>{
      const[data,setdata]=useState({
        "fname":"",
        "lname":"",
        "email":"",
        "acode":"0",
        "phnum":"0",
        "cont":""
      })

      useEffect(()=>{
          callfunction()
      })

      const callfunction=()=>{
          setdata(see(val.where))
      }

      return(
          <>
          <div className="container p-5">
              <div className="row justify-content-center">
                  <div className="card text-light">
                      <div className="row">
                      <button className="btn btn-dark col">{data.fname}</button>
                      <button className="btn btn-warning col">{data.lname}</button>
                      <button className="btn btn-info col">{data.email}</button>
                      <button className="btn btn-secondary col">{data.acode}</button>
                      <button className="btn btn-danger col">{data.phnum}</button>
                      <button className="btn btn-primary col">{data.cont}</button>
                      </div>
                  </div>
              </div>
          </div>
          </>
      )
}
